import React from "react";

export default function About (){
    return (
        <>
         <article>
            <h1>John Santamaria</h1>
            <figure>
                <img src="https://instagram.fbog4-1.fna.fbcdn.net/v/t51.2885-15/233451400_287221459911286_8267458847900255433_n.jpg?stp=dst-jpg_e35&_nc_ht=instagram.fbog4-1.fna.fbcdn.net&_nc_cat=110&_nc_ohc=k6lpbx0qPdMAX-1YklY&edm=ALQROFkBAAAA&ccb=7-5&ig_cache_key=MjYzMzEyOTY2MTQyMTc4NzA3NA%3D%3D.2-ccb7-5&oh=00_AfACuZmp5EcAu5ZTxKOR-KT1NDpocfLNHHLx-mPz4FB7BQ&oe=6390B673&_nc_sid=30a2ef" alt="" />
            </figure>
            <p> This is a project created by me, I was guided by Henry's instructors. I used CSS, and React  </p>
         </article>
            <hr/>
            <h2>What is this?</h2>
            <p>The Rick and Morty API is a REST(ish) and GraphQL API based on the television show Rick and Morty. You will have access to about hundreds of characters, images, locations and episodes. The Rick and Morty API is filled with canonical information as seen on the TV show.</p>
            <h2>Copyright?</h2>
            <p>Rick and Morty is created by Justin Roiland and Dan Harmon for Adult Swim. The data and images are used without claim of ownership and belong to their respective owners.</p>
            <hr/>


        </>
    );
}
